from aiogram import typesfrom aiogram.types import InlineKeyboardButton, InlineKeyboardMarkup, ReplyKeyboardMarkup, KeyboardButtonkb = [    [types.KeyboardButton(text="Foxtrot")],    [types.KeyboardButton(text="Moyo")],    [types.KeyboardButton(text="KTC")],    [types.KeyboardButton(text="Click")],    [types.KeyboardButton(text="Rozetka")],    [types.KeyboardButton(text="Auchan")],    [types.KeyboardButton(text='Setevuha')],    [types.KeyboardButton(text="WO")],    [types.KeyboardButton(text="CAN")],    [types.KeyboardButton(text='ItBox')],    [types.KeyboardButton(text='Citrus')]]def get_custom_keyboard():    buttons = [        [KeyboardButton(text="Foxtrot"), KeyboardButton(text="Moyo"), KeyboardButton(text="KTC")],        [KeyboardButton(text="Click"), KeyboardButton(text="Rozetka"), KeyboardButton(text="Auchan")],        [KeyboardButton(text='Setevuha'), KeyboardButton(text='WO'), KeyboardButton(text='CAN')],        [KeyboardButton(text='ItBox'), KeyboardButton(text='Citrus')]    ]    keyboard = ReplyKeyboardMarkup(keyboard=buttons, resize_keyboard=True)    return keyboard